import { LOCALES } from "../locales";

export default {
    [LOCALES.Uzbek]:{
        'hello':'Salom ',
        'greeting':'Salom {path}',
        'logo':'React bozor',
        'home':'Bosh sahifa',
        'list':'Mahsulotlar',
        'contact':'Aloqa',
        'animation':'Animatsiya',
        'login':'Kirish',
        'register':'Registratsiya',
        'uz':"O'zbek",
        'ru':'Rus tili',
        'en':'Ingliz tili',
        'username':'Foydalanuvchi nomi',
        'password':'Parol',
        'submit':"Jo'natish",
        'email':'Elektron pochta',
        'confirm_pass':'Tasdiqlash parol',
        'map':'Xarita',
        'c_a':"E'lon qo'shish",
        'y_a':'Sizning Elonlaringiz',
        'cart':'Savatcha',
        'wishlist':'Sevimlilar',
        'buy':'Xarid qilish',
        'name':'Ismingiz',
        'number':'Telefon Nomer',
        'message':'Xabar',
        form:{
            email:{
                placeholder:'Sizning elektron pochtangiz'
            }
        },
        form_contact:{
            name:{
                placeholder:'Sizning Ismingiz'
            },
            number:{
                placeholder:'Sizning Nomeringiz'
            }
        }

    }
}
